import React from "react";

export default function List() {
  return (
    <div className="card">
      Address: <br />
      Foods: <br />
      Description: <br />
      <button type="button" class="btn btn-info">Share</button>
      <button type="button" class="btn btn-secondary">Direction</button>
    </div>
  );
}
